(1, 'main page', ' welcome tou800 ouru800 au800-zu800 guide onu800 theu800 process ofu800 building au800 house. youu800 canu800 nowu800 refer advices foru800 each anu800 every step ofu800 building your dream home. youu800 canu800 find au800 variety ofu800 guidance about what tou800 dou800 when tou800 dou800 andu800 howu800 tou800 dou800 inu800 each step ofu800 theu800 construction process including theu800 regulations. file baaslkwikimainu82ejpgu800 right 500px steps inu800 theu800 process ofu800 building au800 house steps inu800 theu800 process ofu800 building au800 house steps inu800 theu800 process ofu800 building au800 house purchasing au800 land hiring au800 service provider maintaining relationship with service providers building regulations planning permissions continuous inspections completion tasks maintaining your house consult theu800 metau82ewikimediau82eorgu800 wiki help contents user user''su800 guide foru800 information onu800 using theu800 wiki software. getting started getting started getting started wwwu800u82emediawikiu82eorgu800 wiki special mylanguage manual configuration_settings configuration settings list wwwu800u82emediawikiu82eorgu800 wiki special mylanguage manual faqu800 mediawiki faqu800 mediawiki release mailing list wwwu800u82emediawikiu82eorgu800 wiki special mylanguage localisation#translation_resources localise mediawiki foru800 your language '),
(2, 'purchasing au800 land', ' theu800 most important point tou800 note isu800 verifying theu800 clarity ofu800 theu800 plan. purchasing from au800 person benefits getu800 au800 land foru800 reasonable price. andu800 there areu800 some customers whou800 prefer calm areas tou800 live. drawbacks owner canu800 mislead theu800 customer easily. customer mayu800 have nou800 idea about theu800 area. au800 solution foru800 theu800 drawbacks isu800 tou800 asku800 from people whou800 live inu800 theu800 area about theu800 history ofu800 land. purchasing from au800 land sale youu800 should check &quot;veethi reka sahathikaya&quot; foru800 part ofu800 theu800 land which going tou800 buyu800. because theu800 permission foru800 whole land will notu800 ensure theu800 validity ofu800 theu800 theu800 part ofu800 land tou800 make au800 building buyer have tou800 consider about price waterflow drainage electricity supply etcu800. benefits people areu800 inu800 same social level easy tou800 take loans reliabilty isu800 high drawbacks usually high prices mayu800 beu800 au800 crowded surrounding youu800 canu800 nowu800 bidu800 foru800 lands published inu800 ouru800 bidding section. these bids consists ofu800 land which areu800 tou800 beu800 sold offered byu800 reputed land sales companies. '),
(3, 'hiring au800 service provider', ' &nbsp; theu800 factors that youu800 need tou800 consider when selecting au800 service provider foru800 theu800 tasks. 1u800. competence- theu800 competence ofu800 au800 service provider will beu800 theu800 basic requirement foru800 anyu800 type ofu800 service provider. some ofu800 theu800 service providers should beu800 qualified such asu800 au800 qualified architect. theu800 technical expertise ofu800 some service providers such asu800 electricians areu800 critical when building theu800 house. 2u800. experience- more theu800 service provider isu800 experienced itu800 isu800 theu800 better. 3u800. past work- ifu800 au800 service provider hasu800 worked inu800 your area previously heu800 will know more regarding theu800 conditions ofu800 theu800 area such asu800 geography weather etcu800. therefore selecting au800 service provider whou800 knows about your area would beu800 helpful. 4u800. opinions given byu800 hisu800 customers- this mayu800 beu800 theu800 best source ofu800 selecting au800 service provider. atu800 present normally theu800 customers rely onu800 au800 word-ofu800-mouth recommendation ofu800 some oneu800 tou800 select au800 service provider. ifu800 theu800 recommender makes anu800 error ofu800 judgement andu800 ifu800 theu800 customer does notu800 getu800 another opinion ofu800 au800 different person heu800 will getu800 mislead. youu800 will realise theu800 importance ofu800 baasu82elku800 considering this because inu800 here more customers could post comments andu800 make reviews sou800 itu800 isu800 easier tou800 understand whou800 isu800 theu800 best service provider foru800 your purpose. &nbsp; &nbsp; '),
(4, 'maintaining relationship with service providers', ' 1u800u82eu8c2a0on-site visitsu82eu8c2a0an onu800-site visit isu800 critical tou800 successful planning. this isu800 important ifu800 theu800 service provider isu800 newu800 tou800 theu800 site oru800 ifu800 theu8c2a0customer theu8c2a0customer''su800 tasks notu800 previously performed byu800 that contractoru82eu8c2a0 2u800u82eu8c2a0a detailed review ofu800 theu800 scope ofu800 theu800 requested worku82eu8c2a0both parties need tou800 review allu800 theu800 steps involved inu800 accomplishing theu800 project project''su800 scope. this mayu800 sound elementary butu800 ifu800 omitted theu800 results areu800 frequently undesirable. having au800 detailed step-byu800-step plan that both parties understand ensures theu800 expected resultsu82eu8c2a0 3u800u82eu8c2a0upfront discussion ofu800 quality expectationsu82eu8c2a0each customer hasu800 different expectations foru800 quality andu800 itu800 isu8c2a0critical foru800 them tou800 communicate detailed quality expectations tou800 theu800 contractor. 4u800u82eu8c2a0project-specific safety planningu82eu8c2a0getting theu800 jobu800 done safely isu800 ofu800 mutual andu800 vital importance. customer andu800 service provider should agree onu800 theu800 scope-specific safety elements. changes inu800 project conditions oru800 scope areu800 reasons tou800 revisit safety planningu82eu8c2a0 5u800. establishing au800 point ofu800 contact foru800 both partiesu82eu8c2a0this isu800 theu800 first step inu800 creating rapport andu800 relationship building andu800 ensures successful communications throughout theu800 project. au800 designated point ofu800 contact improves theu800 interactions between theu800 service provider andu800 theu800 customer. 6u800u82eu8c2a0timelinesu82eu8c2a0an agreed project timeline isu800 valuable foru800 both parties. theu800 customer canu800 plan hisu800 future andu800 theu800 contractor canu800 provide anu800 accurate cost estimate asu800 well asu800 honor other commitmentsu82eu8c2a0 7u800u82eu8c2a0clarifying payment terms andu800 conditionsu82eu8c2a0both parties need tou800 agree onu800 payment terms andu800 conditions. before theu800 project theu800 service provider should provide anu800 agreed feeu800 foru800 additional work oru800 unanticipated changes inu800 scope. this prevents misunderstandings andu800 promotes au800 strong relationship between customer andu800 service provider. '),
(5, 'building regulations', ' open spaces tou800 beu800 provided 38u800 1u800 inu800 every building tou800 beu800 erected onu800 au800 lotu800 wherever anu800 open yard oru800 space isu800 provided foru800 inu800 andu800 around theu800 building theu800 position andu800 theu800 dimension ofu800 itu800 shall beu800 inu800 accordance with theu800 plans approved byu800 theu800 authority under these regulations andu800 provisions ofu800 regulation 35u800 andu800 ''form cu800 38u800 2u800 inu800 theu800 case ofu800 building where anu800 open space isu800 intended tou800 beu800 provided onu800 theu800 site foru800 purpose ofu800 access maintenance ofu800 theu800 building inu800 separating itu800 from adjoining properties such open space shall inu800 nou800 case beu800 less than 1u800u82e0u800 mu800. inu800 width boundary clearance 39u800 1u800 theu800 boundary clearance required tou800 beu800 provided inu800 building shall beu800 asu800 stipulated inu800 form cu800 ofu800 regulation 35u800 andu800 asu800 required byu800 theu800 code ofu800 fire precaution foru800 buildings overhangs andu800 other sunu800-shading devices foru800 buildings 39u800 2u800 notwithstanding theu800 provisions ofu800 regulation 40u800 theu800 overhangs canopies wings oru800 other sunu800-shading devices ofu800 au800 building shall beu800 permitted tou800 project upu800 tou800 1u800u82e0u800 mu800. beyond theu800 building line provided that theu800 roofing materials used areu800 ofu800 theu800 nonu800-combustible type. rear space 40u800 1u800 foru800 theu800 purpose ofu800 this regulation theu800 rear ofu800 theu800 building shall beu800 deemed tou800 beu800 theu800 face which isu800 further from anyu800 street onu800 which theu800 building isu800 situated; provided that where theu800 building isu800 situated onu800 more than oneu800 street theu800 rear ofu800 theu800 building unless theu800 authority authorises oru800 directs shall beu800 deemed tou800 beu800 theu800 face which isu800 furthermost from theu800 widest portion ofu800 such street irregular shape 40u800 2u800 inu800 sites ofu800 irregular shapes where itu800 isu800 impracticable tou800 provide anu800 open space tou800 theu800 entire width ofu800 theu800 rear theu800 authority mayu800 direct that theu800 open space ofu800 theu800 rear shall beu800 left asu800 itu800 deems appropriate having regard tou800 theu800 circumstances ofu800 theu800 case. width ofu800 footway required tou800 beu800 provided 41u800 1u800 anyu800 uncovered footway oru800 arcade verandah-wayu800 required tou800 beu800 provided andu800 constructed shall beu800 - au800 located within theu800 building lotu800; bu800 continuous along theu800 entire portions ofu800 theu800 building lotu800 abutting theu800 street oru800 asu800 otherwise directed byu800 theu800 authority access from au800 street 42u800 every building tou800 beu800 erected onu800 au800 lotu800 which does notu800 abut au800 public street shall have access from au800 private street andu800 theu800 means nature andu800 width ofu800 theu800 access shall beu800 inu800 accordance with au800 subu800-division plan andu800 private streets approved byu800 theu800 authority. theu800 owner ofu800 such building lotu800 shall have legal right over such street. splayed corners 43u800 au800 where au800 building isu800 erected atu800 theu800 junction ofu800 twou800 streets andu800 inu800 theu800 case where theu800 degree ofu800 splay oru800 rounding offu800 isu800 notu800 shown onu800 theu800 development plan oru800 anyu800 statutory document theu800 corner ofu800 such building shall beu800 splayed oru800 rounded offu800 asu800 provided inu800 section 32u800 tou800 au800 height ofu800 notu800 less than 6u800u82e0u800 mu800 above theu800 street level. 43u800 bu800 au800 fence oru800 boundary wall notu800 exceeding 2u800 metres inu800 height mayu800 beu800 permitted onu800 theu800 street line. '),
(6, 'planning permissions', ' &nbsp; newu800 buildings alterations andu800 enlargement ofu800 existing buildings change ofu800 uses ofu800 buildings andu800 changes ofu800 land need planning permission. colombo municipal council asu800 theu800 planning authority hasu800 tou800 ensure that theu800 development isu800 allowed when itu800 isu800 needed while ensuring that theu800 character andu800 amenities ofu800 theu800 area areu800 notu800 adversely affected byu800 theu800 proposed development. planning permission includes approval foru800 subdivision plans approval foru800 building plans andu800 approval foru800 condominium plans. &nbsp; regulations andu800 development control au800 land owner hasu800 au800 reasonable degree ofu800 freedom tou800 develop hisu800 heru800 property oru800 make additions oru800 alterations tou800 theu800 buildings. however individuals mayu800 sometimes beu800 required tou800 sacrifice their interests andu800 forego some ofu800 their privileges inu800 theu800 larger interest andu800 well being ofu800 theu800 community. theu800 larger interests ofu800 theu800 community asu800 au800 whole cannot beu800 sacrificed byu800 allowing haphazard andu800 unplanned dwellings shops factories oru800 anyu800 other buildings oru800 structures. theu800 main objective ofu800 development control isu800 tou800 regulate theu800 growth ofu800 theu800 city inu800 au800 planned andu800 orderly manner. also itu800 isu800 established that development control isu800 absolutely essential tou800 safeguard theu800 interests ofu800 theu800 community. nou800 person institution oru800 state agency carry outu800 oru800 engage inu800 anyu800 development activity within theu800 development area ofu800 theu800 city ofu800 colombo except under theu800 authority which should beu800 inu800 accordance with theu800 development guidelines given inu800 theu800 city ofu800 colombo development plan prepared under section 8au800 andu800 theu800 planning andu800 building regulations under section 21u800 ofu800 urban development authority lawu800 '),
(7, 'continuous inspections', ' &nbsp; your newu800 home should beu800 inspected periodically during theu800 course ofu800 construction. theu800 idea isu800 tou800 catch asu800 many potential problems asu800 possible before construction isu800 finished though some issues mayu800 notu800 surface until youu8e28099ve lived inu800 theu800 home foru800 au800 period ofu800 time. talk tou800 your service provider early onu800 about attending inspections. even ifu800 your presence isu800 notu800 required itu8e28099s anu800 opportunity tou800 learn more about whatu8e28099s behind theu800 walls ofu800 your newu800 home andu800 howu800 everything works. ifu800 youu8e28099re planning tou800 hire your ownu800 service provider tou800 dou800 anu800 additional review ofu800 theu800 home notify your service provider prior tou800 theu800 start ofu800 construction. foru800 safety asu800 well asu800 logistical reasons service providers discourage customers from dropping inu800 unannounced atu800 theu800 construction site. ifu800 youu8e28099d like tou800 payu800 au800 visit beu800 sure tou800 arrange itu800 inu800 advance. chances areu800 your service provider will conduct regular walkthroughs tou800 bring youu800 upu800 tou800 speed onu800 theu800 progress ofu800 theu800 work. '),
(8, 'completion tasks', ' &nbsp; theu800 latter stages ofu800 theu800 process ofu800 building your house mayu800 involve tasks such asu800 installing mirrors curtains oru800 exterior landscaping. after these tasks finishes theu800 newu800 home should beu800 ready foru800 theu800 final inspection before itu800 isu800 handed over tou800 youu800. your service provilder will walk youu800 through your newu800 home tou800 familiarise youu800 with itsu800 features andu800 theu800 operation ofu800 various systems andu800 components andu800 explain your responsibilities foru800 maintenance andu800 upkeep asu800 well asu800 warranty coverage andu800 procedures. this isu800 often referred tou800 asu800 au800 preu800-settlement walkthrough. itu8e28099s also anu800 opportunity tou800 spot items that need tou800 beu800 corrected oru800 adjusted sou800 beu800 attentive andu800 observant. examine theu800 surfaces ofu800 countertops fixtures floors andu800 walls foru800 possible damage. hand-over occurs when theu800 service provider hasu800 completed theu800 project andu800 allu800 money hasu800 been paid inu800 accordance with theu800 contract. onu800 hand-over youu800 become responsible foru800 allu800 service fees andu800 insurances onu800 theu800 property. '),
(9, 'maintaining your house', ' &nbsp; check foru800 loose oru800 leaky gutters. improper drainage canu800 lead tou800 water inu800 theu800 basement oru800 crawl space. make sure downspouts drain away from theu800 foundation andu800 areu800 clear andu800 free ofu800 debris. lowu800 areas inu800 theu800 yard oru800 next tou800 theu800 foundation should beu800 filled with compacted soil. spring rains canu800 cause yard flooding which canu800 lead tou800 foundation flooding andu800 damage. also when water pools inu800 these lowu800 areas inu800 summer itu800 creates au800 breeding ground foru800 insects. useu800 au800 screwdriver tou800 probe theu800 wood trim around windows doors railings andu800 decks. make repairs nowu800 before theu800 spring rains dou800 more damage tou800 theu800 exposed wood. inspect concrete slabs foru800 signs ofu800 cracks oru800 movement. allu800 exterior slabs except pool decks should drain away from theu800 home home''su800 foundation. fill cracks with au800 concrete crack filler. remove firewood stored near theu800 home. firewood should beu800 stored atu800 least 18u800 inches offu800 theu800 ground atu800 least 2u800 feet from theu800 structure. clean andu800 service theu800 outside unit ofu800 theu800 airu800 conditioning system. clean coils operate more efficiently andu800 anu800 annual service call will keep theu800 system working atu800 peak performance levels. change interior filters onu800 au800 regular basis. check your gasu800 andu800 cooker. clean theu800 cooker andu800 ensure that theu800 gasu800 tubes areu800 free ofu800 anyu800 damages tou800 prevent anyu800 leakages. this isu800 vital foru800 your health andu800 safety. '),
(11, 'baaslkwikimainu82ejpgu800', ' ');
